import React, {useEffect} from "react";
import {connect} from "react-redux";
import {compose} from "redux";
import {withRouter} from "react-router-dom";
import {getXiaomiThunk, search} from "../../Redux/Reduser";
import Xiaomi from "./Xiaomi";


const XiaomiContainer = ({getXiaomiThunk,Search,xiaomi}) => {

    useEffect(()=>{
        getXiaomiThunk();
    },[getXiaomiThunk])
    return<Xiaomi Search={Search} xiaomi={xiaomi}/>
}



const mapStateToProps = (state) => {
    return {
        xiaomi: state.Reduser.xiaomi,
        Search:state.Reduser.search
    }
}

export default compose(
    connect(mapStateToProps,{getXiaomiThunk,search}),
    withRouter
)(XiaomiContainer)
